description:
Anubis vormt een nieuwe bedreiging. Hij is een goa\'uld die ooit \&quot;ascended\&quot; is geweest en half teruggekomen is en daarom veel van de kracht en kennis van de Ouden heeft.


1.Enemies - deel 2 - 29 juni 2001 - Teal\'c is gehersenspoeld door Apophis en is nu weer zijn rechterhand geworden.

2.Threshold - deel 3 - 6 juli 2001 - Na het avontuur met Apophis en de Replicators zijn weer terug in de SGC maar Teal\'C is nog steeds loyaal aan Apophis. Bra\'Tac laat hem een ritueel ondergaan zodat hij weer de oude zou moeten worden.

3.Ascension - 13 juli 2001 - SG-1 vind een uitgestorven beschaving met een hyper modern kanon. Carter wordt bezocht door een Acended wezen die verteld dat hij het kanon heeft gegeven maar dat de beschaving na het tegen de Goa\'Uld te hebben gebruikt en kanon tegen elkaar hebben gebruikt. Carter moet het test vuren stoppen.

4.The Fifth Man - 20 juli 2001 - - een buitenaards wezen doet de leden van SG-1 geloven dat hij het vijfde lid van SG-1 is.


